(409, 934, 3, 'TJ', 'This is TJ hotel', 'Ayesha Zahid', '02145682652', NULL, NULL, 1, 1, 5, NULL, 557, '3:02 PM', '8:02 PM', '2', '3', '', 'pexels-pixabay-271624-hotelMainImg-1660125929.jpg', '', 'Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua.', 1, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Liberty Chowk, Commercial Area Gulberg III, Lahore, Pakistan', '31.5106497', '74.34073769999999', 'Lahore', 'Gulberg III', '162', NULL, NULL, NULL, NULL, 25000, NULL, NULL, NULL, NULL, NULL, NULL, '128', 2, 500, '0', 1, 1, 1, 1, 0, NULL, 'null', 1, '2022-08-10 10:05:29', '2022-08-22 07:05:26'),
(458, 1, 1, 'Hotel Tulip Inn Gulberg', 'Situated within 29 km of Wagah Border and 500 m of Pace Shopping Mall, Hotel Tulip Inn, Gulberg features rooms with air conditioning and a private bathroom in Lahore. This 3-star hotel offers a 24-hour front desk, room service, security and free WiFi. The hotel has family rooms. The rooms in the hotel are fitted with a flat-screen TV and free toiletries. Hotel has a large dinning hall for Buffet Meals. Hotel Tulip Inn, Gulberg offers a continental or halal Buffet breakfast. Vogue Towers is 1.7 km from the accommodation, Liberty Market is 2 km, while Lahore Gymkhana is 3 km from the property. The nearest airport is Allama Iqbal International Airport, 5 km from Hotel Tulip Inn, Gulberg. We speak your language!', 'Afraz Khan', '923004008465', '923224008465', NULL, 0, 1, 3, NULL, 1114, '12:00 AM', '2:00 PM', '1', '1', '', 'WhatsApp-Image-2021-04-27-at-2.46.10-PM-hotelMainImg-1660863765.jpeg', '', 'roadnstays.com will make payment after 07-Days of every guest check-out & roadnstays.com will be charged 15% on every guest reservation.', 2, 2, 0, 3, NULL, NULL, NULL, NULL, NULL, NULL, 'MM Alam Road, Block B 1 Gulberg III, Lahore, Pakistan', '31.5129662', '74.3511007', 'Lahore', 'Gulberg III', '162', NULL, NULL, NULL, NULL, 1975, NULL, NULL, NULL, NULL, NULL, NULL, '12', 1, 100, '0', 0, 1, 1, 1, 1, NULL, 'null', 1, '2022-08-18 23:02:45', '2022-09-03 12:18:58'),
(520, 1082, 3, 'Hotel The Oriel', 'Hotel the oriel Islamabad features accommodations with a restaurant, free private parking, a garden and a terrace. Boasting a 24-hour front desk.', 'Rahim Jadoon', '3149369335', NULL, NULL, 1, 0, 4, NULL, 557, '4:00 AM', '12:00 PM', '1', '1', '', 'Capture3-hotelMainImg-1661862875.jpg', '', NULL, 2, 2, 2, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'Zia Balti & BBQ, G-7/1 G 7/1 G-7, Islamabad, Pakistan', '33.6989681', '73.064934', 'Islamabad', 'G-7', '162', NULL, NULL, NULL, NULL, 3850, NULL, NULL, NULL, NULL, NULL, NULL, '12', 1, NULL, '0', 0, 1, 0, 0, 0, NULL, 'null', 1, '2022-08-30 12:34:35', '2022-09-03 13:40:32'),
(522, 1, 1, 'Hilton Hotel Bypass', 'Delux Room at Swat Hilton Hotel Bypass Mingora Swat', 'Raffiullah khan', '3440025026', NULL, NULL, 0, 0, 5, NULL, 1115, '2:00 PM', '10:00 PM', '1', '2', '', 'Frront-side-2-1-hotelMainImg-1662289230.jpeg', '', '1) Partial payment policy. 2) venrooms share is 15%. 3) They don\'t digitally managed service, venrooms will manage the dashboard. 4) Contract Type: Digitally Management Only. CEX ID: 10022', 2, 2, 0, 3, NULL, NULL, NULL, NULL, NULL, NULL, 'Swat Garden Centre, General Bus Station, Bypass road, near Mingora, Mingora, Pakistan', '34.788096', '72.3447999', 'Swat', 'Mingora', '162', NULL, NULL, NULL, NULL, 9200, NULL, NULL, NULL, NULL, NULL, NULL, '12', 0, NULL, '0', 0, 0, 0, 0, 0, NULL, 'null', 1, '2022-09-04 11:00:30', '2022-09-04 06:00:30'),
